"H5034":{"lemma":"נָבֵל","xlit":"nâbêl","pron":"naw-bale'","derivation":"a primitive root;","strongs_def":"to wilt; generally, to fall away, fail, faint; figuratively, to be foolish or (morally) wicked; causatively, to despise, disgrace","kjv_def":"disgrace, dishounour, lightly esteem, fade (away, -ing), fall (down, -ling, off), do foolishly, come to nought, [idiom] surely, make vile, wither."},
