"H5039":{"lemma":"נְבָלָה","xlit":"nᵉbâlâh","pron":"neb-aw-law'","derivation":"feminine of H5036 (נָבָל);","strongs_def":"foolishness, i.e. (morally) wickedness; concretely, a crime; by extension, punishment","kjv_def":"folly, vile, villany."},
"H5040":{"lemma":"נַבְלוּת","xlit":"nablûwth","pron":"nab-looth'","derivation":"from H5036 (נָבָל);","strongs_def":"properly, disgrace, i.e. the (female) pudenda","kjv_def":"lewdness."},
"H5041":{"lemma":"נְבַלָּט","xlit":"Nᵉballâṭ","pron":"neb-al-lawt'","derivation":"apparently from H5036 (נָבָל) and H3909 (לָט); foolish secrecy;","strongs_def":"Neballat, a place in Palestine","kjv_def":"Neballat."},
